"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?20/2/20521/abstract/1\">",
"      Sokol RJ, Booker DJ, Stamps R, et al. IgA red cell autoantibodies and autoimmune hemolysis. Transfusion 1997; 37:175.",
"     </a>",
"    </li>",
