"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Importance of blood pressure on clot dissolution",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 375px; height: 242px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Dogs with a left anterior descending coronary artery occlusion by thrombus were made hypotensive by phlebotomy. Rates of thrombolysis (percent per 30 min) were depressed by low BP and restored with norepinephrine (NE) titrated to a systolic BP of 130 mmHg or with intraaortic balloon counterpulsation (IABC).",
"    <div class=\"footnotes\">",
"    </div>",
