"     Data from: Prewitt RM, Gu S, Garger PJ, Ducas J. J Am Coll Cardiol 1992; 20:1626, and Prewitt RM, Gu S, Schick U, Ducas J. J Am Coll Cardiol 1994; 23:794.",
