"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Ventilatory sensitivity to hypercapnia in end-stage renal disease patients whose apnea improved (A) or did not improve (B) following conversion from conventional hemodialysis (CHD) to nocturnal hemodialysis (NHD)",
