" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 474px\">",
"   <div class=\"ttl\">",
"    Suggested protocol for thyroid screening in preterm infants",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 454px; height: 670px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Protocol may vary depending on infant's gestational age and on whether the screening program uses T4 versus TSH as a primary screening test.",
"    <div class=\"footnotes\">",
"     DOL: day of life; T4: thyroxine; TSH: thyrotropin stimulating hormone.",
"     <br/>",
"     * If the abnormal result is low T4 but",
"     <em>",
"      normal",
"     </em>",
"     TSH, most programs recommend a second screening test (on a new heelstick sample) between two and four weeks of age. If this result also is abnormal, then proceed to serum testing. If the initial result is low T4",
"     <em>",
"      and",
"     </em>",
"     elevated TSH, then proceed directly to serum testing to confirm the result.",
"    </div>",
"    <div class=\"reference\">",
